import { useGLTF } from "../hooks/useModel";

const glbUrl = "/objects/duck.glb";

const Room = ({ url, animation, ...props }) => {
  const glb = useGLTF(glbUrl);

  return (
    <primitive object={glb.scene} dispose={null} {...props} />
  );
};

export default Room;
